import './Campaigns.css';
import React from "react";

const Campaigns = () => {
  return (
    <div className="campaigns-div">
      <div className="campaigns-div-header">
        <h2>Campaigns</h2>
        <button className="create-new-campaign-button">Create New Campaign</button>
      </div>
    </div>
  );
}

export default Campaigns;
